import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: "e1",
      title: "toiletpaper",
      amount: 944,
      date: new Date(2020, 7, 14),
    },

    {
      id: "e2",
      title: "Car Insurances",
      amount: 2000,
      date: new Date(2020, 5, 13),
    },

    { id: "e3", title: "fooding", amount: 347, date: new Date(2020, 7, 23) },
  ];

  return (
    <div>
      <h2>Lets get started!</h2>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      ></ExpenseItem>
    </div>
  );
}
export default App;
